import React from "react";

import Button from "./components/Button";


function App() {

  return (
    <div className="App h-screen w-screen bg-gray-600">
      <div class="container flex mb-4 bg-gray-400 mx-auto">

      <button class="bg-blue-500 hover:bg-blule-400 text-white font-bold py-2 px-4 rounded">
        Test
      </button>


      </div>

      <div class="container flex mb-4 bg-gray-400 mx-auto">

      </div>

      <div class="container shadow-lg bg-gray-400 max-w-lg h-64 rounded overflow-hidden mx-auto">
        ETH-USDC graph

      </div>


    </div>
  );
}

export default App;








